Route::get("/system/product/{minWords}/{maxWords}", function ($minWords, $maxWords) {
        $result = [
            "count" => 0,
            "products" => []
        ];
        $query = DB::table("chi_product");
        $query->whereIn("status", [
            \Product::STATUS_ENABLE,
            \Product::STATUS_HOT,
            \Product::STATUS_PENDDING,
            \Product::STATUS_ORDER]
        )->where("not_for_sale", "=", 0);
        $products = $query->get(["code","title", "content", "slug"]);
        foreach ($products as $product) {
            $content = strip_tags($product->content);
            if (str_word_count($content) >= $minWords && str_word_count($content) <= $maxWords) {
                $result["count"] ++;
                $result["products"][] = [
                    "code" => $product->code,
                    "title" => $product->title,
                    "words" => str_word_count($content),
                    "url" => "https://chiaki.vn/" . $product->slug,
                ];
            }
        }
        usort($result["products"], function ($a, $b) {
            if ($a['words'] == $b['words']) return 0;
            return ($a['words'] < $b['words']) ? -1 : 1;
        });
        return Response::json($result);
    });
